import React from 'react'
import { Calendar } from 'react-big-calendar'

const MyCalendar = (props) => (
    <div>
        <Calendar />
    </div>
)

const HomeScreen = () => {
    return(
        <div>
            <h1>Spinal Health Organiser</h1>
            <Calendar />
        </div>
    )
}

export default HomeScreen
